import React from "react";
import items from "../../shared/itemImages";

export class ProductCard extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isOutOfStock: false
        }
    }
  render() {
    const cardObjects = Array.from(items
        .find((x) => x.images)
        .images.map((x) => ({ name: x, isOutOfStock: false })));
        console.log(cardObjects)
    return cardObjects.name.map((img) => (
        <div className="card">
          <img className="item-image" src={img}></img>
          <img className="buy-icon" src="./buy-icon.svg"></img>
          <div className="item-info">
            <p>
                Apollo Running Short
            </p>
            <p className="price">
                $50.00
            </p>
          </div>
        </div>
      ));
  }
}
